import React from 'react'
import styled from 'styled-components'

const Form = styled.div`
    display: flex;
    margin: auto;
    flex-direction: column;
    width: 50%;
    margin-top: 10vh;
`

const InputBox = styled.input`
    height: 40px;
    width: max-content;
`
const UploadButton = styled.button`
    height: 40px;
    width: max-content;

`
const AddButton = styled.button`
    height:  20px;
    width: min-content;
`


function FoodForm() {
    return (
        
        <Form>
                <h1>Upload food</h1>
                <InputBox placeholder ="Title"></InputBox>
                

                
                <InputBox placeholder ="Price"></InputBox>
                

                
                <InputBox placeholder = "Ingredients"></InputBox>
                <AddButton>Add</AddButton>
                <UploadButton>Upload it</UploadButton>

                
                                
        </Form>
           
        
    )
}

export default FoodForm
